import React, { Component } from 'react';
import './index.css';

export class Header extends Component {
  render() {
    return (
      <div>
        <div>
          <p id="title-header">THE ROAD TO REACT</p>
          <p id="subTitle-header">FIRST 20 REPOS</p>
        </div>
      </div>
    )
  }
}

export default Header
